<script>
import * as d3 from "d3";
export default {
  props: {
    checkedList: Array
  },
  data() {
    return {
      curSprite: {
        name: null,
        fre: null,
        unit: null
      },
      times: null
    };
  },
  components: {},
  computed: {
    display() {
      return function(val) {
        var obj = this.checkedList.find(ele => ele.serviceName == val);
        if (obj) {
          return "display:block";
        } else {
          return "display:none";
        }
      };
    },
    fill() {
      return function(val) {
        var obj = this.checkedList.find(ele => ele.serviceName == val);
        if (obj) {
          if (obj.color) {
            return obj.color;
          } else {
            return "#FFFFFF";
          }
        }
      };
    }
  },
  mounted() {
    this.zoomimg();
    this.onDblclick();
    this.onClick();
    this.onMouseMove();
  },
  methods: {
    //双击事件
    onDblclick() {
      d3.selectAll(".service").on("dblclick", d => {
        clearTimeout(this.times);
        if (d.currentTarget.getAttribute("data-fre")) {
          var freList = d.currentTarget.getAttribute("data-fre").split(";");
          var fre = freList[0].split("-");
          var data = {
            start: fre[0],
            end: fre[1],
            unit: freList[1]
          };
          this.$emit("detail", data);
        }
      });
    },
    //单击事件
    onClick() {
      d3.selectAll(".service").on("click", d => {
        if (d.currentTarget.getAttribute("data-fre")) {
          var freList = d.currentTarget.getAttribute("data-fre").split(";");
          var fre = freList[0].split("-");
          var data = {
            start: fre[0],
            end: fre[1],
            unit: freList[1],
            serviceName: d.currentTarget.getAttribute("data-name")
          };
          clearTimeout(this.times);
          d3.selectAll("rect").classed("cur", false);
          d3.selectAll("polygon").classed("cur", false);
          d.currentTarget.children[0].setAttribute("class", "cur");
        }
      });
    },
    //悬浮事件
    onMouseMove() {
      var _this = this;
      d3.selectAll(".service")
        .on("mouseover", d => {
          _this.curSprite.name = d.currentTarget.getAttribute("data-name");
          var fre = d.currentTarget.getAttribute("data-fre").split(";");
          _this.curSprite.fre = fre[0];
          _this.curSprite.unit = fre[1];
          document.getElementById("info-box").style.left = d.layerX + "px";
          document.getElementById("info-box").style.top = d.layerY + "px";
          document.getElementById("info-box").style.opacity = 10;
        })
        .on("mouseout", () => {
          document.getElementById("info-box").style.opacity = 0;
        });
    },
    // 放大缩小
    zoomimg() {
      var svg = d3.select("#svgcanvas");
      var zoom = d3
        .zoom()
        .scaleExtent([1, 5])
        .on("zoom", d => {
          console.log(d);
          svg.selectAll(".zoom").attr("transform", d.transform);
        });
      svg.call(zoom).on("wheel");
    },
    //重置缩放
    restZoom() {
      var svg = d3.select("#svgcanvas");
      var zoom = d3
        .zoom()
        .scaleExtent([1, 5])
        .on("zoom", d => {
          svg.selectAll(".zoom").attr("transform", d.transform);
        });
      svg.call(zoom.transform, d3.zoomIdentity.scale(1));
    }
  }
};
</script>

